import React from 'react';
import '../App.css';

function Nav() {
    return (
        <nav>
            <h3>Logo</h3>
            <ul>
                <li>Home</li>
                <li>01.About</li>
                <li>02.Experience</li>
                <li>03.Work</li>
                <li>04.Contact</li>
                <li>Resume</li>
            </ul>
        </nav>
    )
}

export default Nav;
